import React from "react";

import "./AuthPage.css";

import bg from "../../images/bg_login.jpg";
import yaLogo from "../../images/logo_yandex.png";

const AuthPage = () => {
    return (
        <div id="auth-page">
            <img id="bg" src={bg} alt="" />
            <div>
                <img src={yaLogo} alt="" />
            </div>
        </div>
    );
}

export default AuthPage;
